import { useState } from "react";
import data from "../data.js";

function Main (){

    return(
    <div>
    <h1>심리테스트</h1>
    {
    data.map(function(test , i){
        return(
            <h4> {test.text} 
            {test.answer1}</h4>
        )
    }
        )}
    </div>
    )
}

export default Main;
